import "../index.css";
import Card from "./Card";
const Info = (props) => {
  console.log("Hello there");
  return (
    <Card className="concepts">
      {props.concepts.map((item) => (
        <li className="concept" key={item.title}>
          <div>
            <div className="mid">
              <img src={item.image} alt="Todo" />
            </div>
            <br />
            <div>
              <h2>{item.title}</h2>
              <br />
              <p>{item.description}</p>
            </div>
          </div>
        </li>
      ))}
    </Card>
  );
};
export default Info;
